(9, 'appointment_confirmation', 'Appointment Confirmation', '<p>Dear {patient_name},</p>\r\n\r\n<p>Your appointment has been confirmed on time {schedule_time} and day {appointment_date} in {doctor_name} laboratory. </p>\r\n', '{institute_name}, {patient_name}, {doctor_name}, {consultation_fees}, {schedule_time}, {appointment_date}', 1),
