(11, 'appointment_requested_patient', 'Appointment Requested', '<p>Dear {patient_name},</p>\r\n\r\n<p>Your appointment request has been received at {doctor_name}. Following are details:</p>\r\n\r\n<p>Appointment Schedule: Day {appointment_date} and Time {schedule_time} in {doctor_name}<p>\r\n', '{institute_name}, {patient_name}, {doctor_name}, {consultation_fees}, {schedule_time}, {appointment_date}', 1),
(12, 'appointment_requested_lab', 'Appointment Request', '<p>Dear {doctor_name},</p>\r\n\r\n<p>Appointment requestof patient {patient_name} has been received. Following are details:</p>\r\n\r\n<p>Appointment Schedule: Day {appointment_date} and Time {schedule_time} in {doctor_name}<p>\r\n', '{institute_name}, {patient_name}, {doctor_name}, {consultation_fees}, {schedule_time}, {appointment_date}', 1);
INSERT INTO `front_cms_about` (`id`, `title`, `subtitle`, `page_title`, `content`, `banner_image`, `about_image`, `elements`, `meta_description`, `meta_keyword`) VALUES
(1, 'Welcome to Zippy Lab Tests', 'Best Medical &amp; Healthcare Needs to Our Patients', 'About Us', '<p style=\"text-align: justify;\"><span style=\"font-family:Georgia,serif;\"><span style=\"font-size:12.0pt\">Overall healthcare costs in the US are anticipated to rise by an average of 5.5% per year over the next decade to over $6 trillion. Americans spend a huge amount of money on healthcare each year. High insurance premiums, high deductibles, copays, and other out of pocket expenses are just some of the costs associated with health and wellness in the country. More than 30 million people today don&rsquo;t have health insurance and even more are underinsured in our country. Still for those with insurance, the costs are so high that medical bills are the number one cause of bankruptcy in the United States. </span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family:Georgia,serif;\"><span style=\"font-size:12.0pt\">Zippy Lab Test (ZLT) is a Direct-to-Consumer Point-of-Care (POC) lab testing service that offers consumers an Affordable, Confidential &amp; Fast lab testing option to monitor and manage their own health and significantly reduce their healthcare cost. </span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family:Georgia,serif;\"><span style=\"font-size:12.0pt\">Zippy Lab Test provides onsite testing at partner locations near you. The tests are performed by certified technicians using FDA approved testing solutions. Most results are provided within 30 minutes after sample collection. The results of your biometric tests are presented in an easy-to-understand confidential report for important health concerns such as diabetes, cholesterol levels, cardiovascular problems, and other high-risk conditions.</span></span></p>\r\n\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size:12pt\"><span style=\"font-family:Cambria,serif\">SOME INTERESTING FACTS</span></span></strong></p>\r\n\r\n<p style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"font-family:Cambria,serif\"><b>1. Cardiovascular Disease (CVD) is the leading cause of death for Americans:</b></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"font-family:Cambria,serif\">41.5% of the US population has at least one CVD Condition.</span></span></li>\r\n	<li style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"font-family:Cambria,serif\">Total medical costs for CVD were $318 billion in 2015.</span></span></li>\r\n	<li style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"font-family:Cambria,serif\">Total lost productivity was $237 billion.</span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-left:25px; margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"font-family:Cambria,serif\"><i>American Heart Association, 2017. Cardiovascular Disease: A costly burden for America.&nbsp; Projections through 2035.</i></span></span></p>\r\n\r\n<p style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"font-family:Cambria,serif\"><b>2. High cholesterol is a major controllable risk factor for CVD:</b></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"margin-bottom: 15px;\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Cambria&quot;,&quot;serif&quot;\">36.7% of the US populations may be in need of treatment for high cholesterol. </span></span><a href=\"https://www.ncbi.nlm.nih.gov/pubmed/29386200\">Read More</a></li>\r\n	<li style=\"margin-bottom: 15px;\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Cambria&quot;,&quot;serif&quot;\">For every 1% drop in total cholesterol, the risk of a heart attack drops by 2-3%. </span></span><a href=\"https://www.ncbi.nlm.nih.gov/pubmed/1533273)\">Read More</a></li>\r\n	<li style=\"margin-bottom: 15px;\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Cambria&quot;,&quot;serif&quot;\">20-30% of companies annual healthcare expenditures are spent on employees with modifiable risk factors. </span></span><a href=\"https://www.ncbi.nlm.nih.gov/pubmed/25869199\">Read More</a></li>\r\n</ul>\r\n\r\n<p style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"font-family:Cambria,serif\"><b>3. Diabetes Facts and Statistics</b></span></span></p>\r\n\r\n<p style=\"margin-bottom:15px\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Cambria&quot;,&quot;serif&quot;\">Diabetes occurs when your blood glucose, also called blood sugar, is too high. High blood glucose can cause health problems over time. The main types of diabetes are type 1, type 2, and gestational. </span></span></p>\r\n\r\n<ul>\r\n	<li style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Cambria,serif\"><b>Total:&nbsp;</b>An estimated 30.3 million people have diabetes (9.4 percent of the U.S. population)</span></span></span></li>\r\n	<li style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Cambria,serif\"><b>Diagnosed:&nbsp;</b>An estimated<b>&nbsp;</b>23.1 million people have been diagnosed with diabetes (7.2 percent of the U.S. population)</span></span></span></li>\r\n	<li style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"tab-stops:list .5in\"><span style=\"font-family:Cambria,serif\"><b>Undiagnosed:&nbsp;</b>An estimated<b>&nbsp;</b>7.2 million adults, ages 18 years or older are undiagnosed (23.8 percent of people with diabetes)</span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Cambria&quot;,&quot;serif&quot;\">View the full report:&nbsp;<a href=\"https://www.cdc.gov/diabetes/pdfs/data/statistics/national-diabetes-statistics-report.pdf\">National Diabetes Statistics Report, 2017</a>&nbsp;(PDF, 1.35 MB)&nbsp;&nbsp;from the Centers for Disease Control and Prevention (CDC)</span></span></p>\r\n\r\n<p style=\"margin-bottom:15px\"><span style=\"font-size:12pt\"><span style=\"font-family:&quot;Cambria&quot;,&quot;serif&quot;\">According to the American Diabetes Association&rsquo;s&nbsp;<a href=\"https://care.diabetesjournals.org/content/early/2018/03/20/dci18-0007\">Economic Costs of Diabetes in the U.S</a>&nbsp;the total estimated cost of diagnosed diabetes in 2017 was $327 billion, including $237 billion in direct medical costs and $90 billion in reduced productivity.&nbsp;<a href=\"https://www.niddk.nih.gov/health-information/health-statistics/diabetes-statistics\">https://www.niddk.nih.gov/health-information/health-statistics/diabetes-statistics</a></span></span></p>', 'about.png', 'about.png', '{\"cta_title\":\"Get in touch to join our community\",\"button_text\":\"Contact Our Office\",\"button_url\":\"contact\"}', '', '');
